import React from 'react';
import "./work.css";


const Work = () => {
  return (
    <div>
      <section className="work section" id="portfolio"></section>
      <h2 className="section__title">Portfolio</h2>
      <span className="section__subtitle">Most recent work</span>

    </div>
  );
};

export default Work;
